    //     <TableBody>

    //     {props.data.length !=0 && props.data.map(({priceId, price,addedDate}) => (
    //         <StyledTableRow key={priceId}>
    //           <StyledTableCell scope="row">{addedDate}</StyledTableCell>
    //           <StyledTableCell align="right">{price}</StyledTableCell>
    //         </StyledTableRow>
    //       ))}
    //     </TableBody>
    //   </Table>
    // </TableContainer>
    <div>
    {data.length !=0 && data.map(({priceId, price,addedDate}) => (
      <div key={priceId}>
        <div>{addedDate}</div>
        <div align="right">{price}</div>
      </div>
    ))}
    </div>
  );
}

export default StockTable;
